script: |
  super -f text -I q11168.spq | sort > q11168.out

inputs:
  - name: q11168.spq
    data: |
      SELECT DISTINCT - + col0 / + col0 AS col1, - col2 * col2 AS col2 FROM tab0 (FORMAT parquet) AS cor0;
  - name: tab0

outputs:
  - name: q11168.out
    data: |
      -1	-100
      -1	-2209
      -1	-9801
